var svg = d3.select('svg');
var width = +svg.attr('width');
var height = +svg.attr('height');
var radius = 3;
var maxX = Number.MIN_VALUE;
var maxY = Number.MIN_VALUE;
data.nodes.forEach(node => {
  let x = node.x;
  let y = node.y;
  maxX = Math.max(maxX, x);
  maxY = Math.max(maxY, y);
});
if(maxX > width || maxY > height) {
  data.nodes.forEach(node => {
    node.x = maxX > width ? node.x * (width - radius) / maxX: node.x;
    node.y = maxY > height ? node.y * (height - radius) / maxY : node.y;
  });
}

var link = svg.append('g')
  .attr('class', 'links')
  .selectAll('line')
  .data(data.edges)
  .enter()
  .append('line')
  .attr("x1", function (d) { return data.nodes[d.source].x; })
  .attr("y1", function (d) { return data.nodes[d.source].y; })
  .attr("x2", function (d) { return data.nodes[d.target].x; })
  .attr("y2", function (d) { return data.nodes[d.target].y; });

var node = svg.append('g')
  .attr('class', 'nodes')
  .selectAll('circle')
  .data(data.nodes)
  .enter()
  .append('circle')
  .attr("cx", function (d) { return d.x; })
  .attr("cy", function (d) { return d.y; })
  .attr("r", radius);